import React from "react";

import Titles from "./components/Titles";

import Form from "./components/Form";

import Weather from "./components/Weather";

const apikey = "e8c18b5b953ba1de2e75fbacc9c226fc";


class App extends React.Component {

	weatherFetch = async (e) => {

		e.preventDefault();

		const city = e.target.elements.city.value;

		const country = e.target.elements.country.value;

		const call_api = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=${city},${country}&appid=${apikey}&units=metric`);

		const data = await call_api.json();

		console.log(data);

	}

	render() {

		return (

			<div>				

			<Titles/>

			<Form weatherFetch = {this.weatherFetch} />

			<Weather/>

			</div>

			);

	}

};


export default App;
